            __builder.AddMarkupContent(0, "<h3 style=\"padding-bottom:12px\">Stakeholder:</h3>\r\n    ");
            __builder.AddMarkupContent(1, "<div class=\"accordion\" id=\"accordionFaqOne\" style=\"box-shadow: 0 4px 8px 0 rgba(0, 0, 0, 0.2), 0 6px 20px 0 rgba(0, 0, 0, 0.19);\"><div class=\"card\"><div class=\"card-header\" id=\"headingOne\"><h2 class=\"mb-0\"><button class=\"btn btn-link\" type=\"button\" data-toggle=\"collapse\" data-target=\"#collapseOne\" aria-expanded=\"false\" aria-controls=\"collapseOne\">\r\n                        Wann ist die erste Alpha Version verfügbar?\r\n                    </button></h2></div>\r\n\r\n            <div id=\"collapseOne\" class=\"collapse\" aria-labelledby=\"headingOne\" data-parent=\"#accordionFaqOne\"><div class=\"card-body\">\r\n                    Dies ist die Alpha Version.\r\n                </div></div></div>\r\n        <div class=\"card\"><div class=\"card-header\" id=\"headingTwo\"><h2 class=\"mb-0\"><button class=\"btn btn-link collapsed\" type=\"button\" data-toggle=\"collapse\" data-target=\"#collapseTwo\" aria-expanded=\"false\" aria-controls=\"collapseTwo\">\r\n                        Wird ein Langzeitsupport angeboten?\r\n                    </button></h2></div>\r\n            <div id=\"collapseTwo\" class=\"collapse\" aria-labelledby=\"headingTwo\" data-parent=\"#accordionFaqOne\"><div class=\"card-body\">\r\n                    Da es ein Open Source Projekt ist, kann die Community selbst Updates erstellen.\r\n                </div></div></div>\r\n        \r\n        <div class=\"card\"><div class=\"card-header\" id=\"headingThree\"><h2 class=\"mb-0\"><button class=\"btn btn-link collapsed\" type=\"button\" data-toggle=\"collapse\" data-target=\"#collapseThree\" aria-expanded=\"false\" aria-controls=\"collapseThree\">\r\n                        Wen kontaktiere ich, wenn ich ein Problem habe?\r\n                    </button></h2></div>\r\n            <div id=\"collapseThree\" class=\"collapse\" aria-labelledby=\"headingThree\" data-parent=\"#accordionFaqOne\"><div class=\"card-body\">\r\n                    Herrn Kofler oder das Entwicklerteam.\r\n                </div></div></div></div>\r\n    \r\n\r\n    \r\n\r\n    ");
            __builder.AddMarkupContent(2, "<h3 style=\"padding-bottom: 12px;\r\n        padding-top: 32px\">Nutzer:</h3>\r\n    ");
            __builder.AddMarkupContent(3, "<div class=\"accordion\" id=\"accordionFaqTwo\" style=\"box-shadow: 0 4px 8px 0 rgba(0, 0, 0, 0.2), 0 6px 20px 0 rgba(0, 0, 0, 0.19);\"><div class=\"card\"><div class=\"card-header\" id=\"headingFive\"><h2 class=\"mb-0\"><button class=\"btn btn-link collapsed\" type=\"button\" data-toggle=\"collapse\" data-target=\"#collapseFive\" aria-expanded=\"false\" aria-controls=\"collapseFive\">\r\n                        Wie bekomme ich einen Zugang?\r\n                    </button></h2></div>\r\n            <div id=\"collapseFive\" class=\"collapse\" aria-labelledby=\"headingFive\" data-parent=\"#accordionFaqTwo\"><div class=\"card-body\">\r\n                    Einfach über die Schaltfläche ‘Register’ im Browser registrieren und die Email Adresse bestätigen.\r\n                </div></div></div>\r\n        \r\n        <div class=\"card\"><div class=\"card-header\" id=\"headingSix\"><h2 class=\"mb-0\"><button class=\"btn btn-link collapsed\" type=\"button\" data-toggle=\"collapse\" data-target=\"#collapseSix\" aria-expanded=\"false\" aria-controls=\"collapseSix\">\r\n                        Sind die Kursinhalte auch offline verfügbar?\r\n                    </button></h2></div>\r\n            <div id=\"collapseSix\" class=\"collapse\" aria-labelledby=\"headingSix\" data-parent=\"#accordionFaqTwo\"><div class=\"card-body\">\r\n                    Man kann sich Kursinhalte als PDF speichern und Videos runterladen.\r\n                    Quizes sind jedoch nur online verfügbar.\r\n                </div></div></div>\r\n        \r\n        <div class=\"card\"><div class=\"card-header\" id=\"headingSeven\"><h2 class=\"mb-0\"><button class=\"btn btn-link collapsed\" type=\"button\" data-toggle=\"collapse\" data-target=\"#collapseSeven\" aria-expanded=\"false\" aria-controls=\"collapseSeven\">\r\n                        Kann ich meinen Kursfortschritt speichern?\r\n                    </button></h2></div>\r\n            <div id=\"collapseSeven\" class=\"collapse\" aria-labelledby=\"headingSeven\" data-parent=\"#accordionFaqTwo\"><div class=\"card-body\">\r\n                    Der Fortschritt wird automatisch gespeichert.\r\n                    Ausnahmen: Zoom Meetings müssen von den Lehrern als erfolgreich absolviert werden.\r\n                </div></div></div>\r\n        \r\n        <div class=\"card\"><div class=\"card-header\" id=\"headingEight\"><h2 class=\"mb-0\"><button class=\"btn btn-link collapsed\" type=\"button\" data-toggle=\"collapse\" data-target=\"#collapseEight\" aria-expanded=\"false\" aria-controls=\"collapseEight\">\r\n                        Woraus besteht ein aLive-Kurs?\r\n                    </button></h2></div>\r\n            <div id=\"collapseEight\" class=\"collapse\" aria-labelledby=\"headingEight\" data-parent=\"#accordionFaqTwo\"><div class=\"card-body\">\r\n                    Jeder aLive-Kurs wird von einem (oder manchmal auch mehreren) Dozenten der LMU Klinikum erstellt und betreut.\r\n                    Grundsätzlich besteht ein aLive-Kurs aus Lektionen, die Videos, Folien und Text enthalten können. Die Dozenten können außerdem Begleitmaterialien und Praxisaktivitäten hinzufügen, um den Kurs interessanter und praxisrelevanter zu gestalten. Es werden außerdem auch live zoom Meetings durchgefürt.\r\n                </div></div></div>\r\n        \r\n        <div class=\"card\"><div class=\"card-header\" id=\"headingNine\"><h2 class=\"mb-0\"><button class=\"btn btn-link collapsed\" type=\"button\" data-toggle=\"collapse\" data-target=\"#collapseNine\" aria-expanded=\"false\" aria-controls=\"collapseNine\">\r\n                        Wie lange kann ich Quizzes bearbeiten?\r\n                    </button></h2></div>\r\n            <div id=\"collapseNine\" class=\"collapse\" aria-labelledby=\"headingNine\" data-parent=\"#accordionFaqTwo\"><div class=\"card-body\">\r\n                    Der Administrator legt fest, wieviel Zeit pro Quiz verfügbar ist.\r\n                </div></div></div>\r\n        \r\n        <div class=\"card\"><div class=\"card-header\" id=\"headingTen\"><h2 class=\"mb-0\"><button class=\"btn btn-link collapsed\" type=\"button\" data-toggle=\"collapse\" data-target=\"#collapseTen\" aria-expanded=\"false\" aria-controls=\"collapseTen\">\r\n                        Welches Feedback erhalte ich nach einem Quiz?\r\n                    </button></h2></div>\r\n            <div id=\"collapseTen\" class=\"collapse\" aria-labelledby=\"headingTen\" data-parent=\"#accordionFaqTwo\"><div class=\"card-body\">\r\n                    Dazu hat der Administrator mehrere Einstellmöglichkeiten:\r\n                    <ul><li>nach jeder Frage, richtig / falsch</li>\r\n                        <li>nach dem Test: Anzahl / Prozentsatz richtig</li>\r\n                        <li>nach dem Test: Auflistung der Antworten, Markierung der richitgen</li></ul></div></div></div>\r\n        \r\n        <div class=\"card\"><div class=\"card-header\" id=\"headingEleven\"><h2 class=\"mb-0\"><button class=\"btn btn-link collapsed\" type=\"button\" data-toggle=\"collapse\" data-target=\"#collapseEleven\" aria-expanded=\"false\" aria-controls=\"collapseEleven\">\r\n                        Kann ich die Fortschritte von anderen sehen?\r\n                    </button></h2></div>\r\n            <div id=\"collapseEleven\" class=\"collapse\" aria-labelledby=\"headingEleven\" data-parent=\"#accordionFaqTwo\"><div class=\"card-body\">\r\n                    Lehrer können dies jederzeit sehen, Studenten können aktivieren, dass sie unter einem Nickname in der Bestenliste geführt werden.\r\n                </div></div></div>\r\n        \r\n        <div class=\"card\"><div class=\"card-header\" id=\"headingTwelve\"><h2 class=\"mb-0\"><button class=\"btn btn-link collapsed\" type=\"button\" data-toggle=\"collapse\" data-target=\"#collapseTwelve\" aria-expanded=\"false\" aria-controls=\"collapseTwelve\">\r\n                        Kann ich mich von einem Kurs abmelden?\r\n                    </button></h2></div>\r\n            <div id=\"collapseTwelve\" class=\"collapse\" aria-labelledby=\"headingTwelve\" data-parent=\"#accordionFaqTwo\"><div class=\"card-body\">\r\n                    Initial ist nur ein Kurs vorgesehen, daher wird diese Funktion vorerst nicht angeboten.\r\n                </div></div></div>\r\n        \r\n        <div class=\"card\"><div class=\"card-header\" id=\"headingThirteen\"><h2 class=\"mb-0\"><button class=\"btn btn-link collapsed\" type=\"button\" data-toggle=\"collapse\" data-target=\"#collapseThirteen\" aria-expanded=\"false\" aria-controls=\"collapseThirteen\">\r\n                        Kann ich mit anderen Kursteilnehmern kontaktieren?\r\n                    </button></h2></div>\r\n            <div id=\"collapseThirteen\" class=\"collapse\" aria-labelledby=\"headingThirteen\" data-parent=\"#accordionFaqTwo\"><div class=\"card-body\">\r\n                    Dazu können Foren in den Lehreinheiten genutzt werden.\r\n                </div></div></div><div class=\"card\"><div class=\"card-header\" id=\"headingFourteen\"><h2 class=\"mb-0\"><button class=\"btn btn-link collapsed\" type=\"button\" data-toggle=\"collapse\" data-target=\"#collapseFourteen\" aria-expanded=\"false\" aria-controls=\"collapseFourteen\">\r\n                        Bekomme ich einen  Nachweis nach der Absolvierung des Kurses?\r\n                    </button></h2></div>\r\n            <div id=\"collapseFourteen\" class=\"collapse\" aria-labelledby=\"headingFourteen\" data-parent=\"#accordionFaqTwo\"><div class=\"card-body\">\r\n                    Ja, du bekommst einen Nachweis nach der Absolvierung der kompletten Lerneinheit.\r\n                </div></div></div><div class=\"card\"><div class=\"card-header\" id=\"headingFifteen\"><h2 class=\"mb-0\"><button class=\"btn btn-link collapsed\" type=\"button\" data-toggle=\"collapse\" data-target=\"#collapseFifteen\" aria-expanded=\"false\" aria-controls=\"collapseFifteen\">\r\n                        Kann man Gruppen bilden?\r\n                    </button></h2></div>\r\n            <div id=\"collapseFifteen\" class=\"collapse\" aria-labelledby=\"headingFifteen\" data-parent=\"#accordionFaqTwo\"><div class=\"card-body\">\r\n                    Nein, das ist auf dem aLive Plattform nicht möglich. Das ist ein individuller Kurs.\r\n                </div></div></div><div class=\"card\"><div class=\"card-header\" id=\"headingSixteen\"><h2 class=\"mb-0\"><button class=\"btn btn-link collapsed\" type=\"button\" data-toggle=\"collapse\" data-target=\"#collapseSixteen\" aria-expanded=\"false\" aria-controls=\"collapseSixteen\">\r\n                        Kann man Gruppen bilden?\r\n                    </button></h2></div>\r\n            <div id=\"collapseSixteen\" class=\"collapse\" aria-labelledby=\"headingSixteen\" data-parent=\"#accordionFaqTwo\"><div class=\"card-body\">\r\n                    Nein, das ist auf dem aLive Plattform nicht möglich. Das ist ein individuller Kurs.\r\n                </div></div></div><div class=\"card\"><div class=\"card-header\" id=\"headingSeventeen\"><h2 class=\"mb-0\"><button class=\"btn btn-link collapsed\" type=\"button\" data-toggle=\"collapse\" data-target=\"#collapseSeventeen\" aria-expanded=\"false\" aria-controls=\"collapseSeventeen\">\r\n                        Wer kann Feedback hinterlassen?\r\n                    </button></h2></div>\r\n            <div id=\"collapseSeventeen\" class=\"collapse\" aria-labelledby=\"headingSeventeen\" data-parent=\"#accordionFaqTwo\"><div class=\"card-body\">\r\n                    Jeder Teilnehmer, der einen Kurs angesehen hat, kann einen Feedback hinterlassen.\r\n                </div></div></div><div class=\"card\"><div class=\"card-header\" id=\"headingEightteen\"><h2 class=\"mb-0\"><button class=\"btn btn-link collapsed\" type=\"button\" data-toggle=\"collapse\" data-target=\"#collapseEightteen\" aria-expanded=\"false\" aria-controls=\"collapseEightteen\">\r\n                        Gibt es Aufgaben zu den Lerneinheiten?\r\n                    </button></h2></div>\r\n            <div id=\"collapseEightteen\" class=\"collapse\" aria-labelledby=\"headingEightteen\" data-parent=\"#accordionFaqTwo\"><div class=\"card-body\">\r\n                    Ja, es gibt Quize zu jedem Kurs. Außerdem gibt es in machen Kursen zusätliche Aufgaben wie ZB. Case studys.\r\n\r\n                </div></div></div><div class=\"card\"><div class=\"card-header\" id=\"headingNineteen\"><h2 class=\"mb-0\"><button class=\"btn btn-link collapsed\" type=\"button\" data-toggle=\"collapse\" data-target=\"#collapseNineteen\" aria-expanded=\"false\" aria-controls=\"collapseNineteen\">\r\n                Von wem bekomme ich den Feedback?\r\n            </button></h2></div>\r\n    <div id=\"collapseNineteen\" class=\"collapse\" aria-labelledby=\"headingNineteen\" data-parent=\"#accordionFaqTwo\"><div class=\"card-body\">\r\n            Jeder aLive-Kurs wird von einem (oder manchmal auch mehreren) Dozenten erstellt und betreut.\r\n        </div></div></div><div class=\"card\"><div class=\"card-header\" id=\"headingTwenty\"><h2 class=\"mb-0\"><button class=\"btn btn-link collapsed\" type=\"button\" data-toggle=\"collapse\" data-target=\"#collapseTwenty\" aria-expanded=\"false\" aria-controls=\"collapseTwenty\">\r\n                Kann ich die abgegebene case study nochmal bearbeiten?\r\n            </button></h2></div>\r\n    <div id=\"collapseTwenty\" class=\"collapse\" aria-labelledby=\"headingTwenty\" data-parent=\"#accordionFaqTwo\"><div class=\"card-body\">\r\n            Die Bearbeitung der Aufgaben sind bis zum Abgabetermin möglich.\r\n        </div></div></div><div class=\"card\"><div class=\"card-header\" id=\"headingTwentyone\"><h2 class=\"mb-0\"><button class=\"btn btn-link collapsed\" type=\"button\" data-toggle=\"collapse\" data-target=\"#collapseTwentyone\" aria-expanded=\"false\" aria-controls=\"collapseTwentyone\">\r\n                Kann ich weiterhin auf den Kurs zugreifen, auch wenn ich ihn bereits abgeschlossen habe?\r\n            </button></h2></div>\r\n    <div id=\"collapseTwentyone\" class=\"collapse\" aria-labelledby=\"headingTwentyone\" data-parent=\"#accordionFaqTwo\"><div class=\"card-body\">\r\n            Der Administrator entschiedet, wie lange der Zugriff gültig ist\r\n        </div></div></div><div class=\"card\"><div class=\"card-header\" id=\"headingTwentytwo\"><h2 class=\"mb-0\"><button class=\"btn btn-link collapsed\" type=\"button\" data-toggle=\"collapse\" data-target=\"#collapseTwentytwo\" aria-expanded=\"false\" aria-controls=\"collapseTwentytwo\">\r\n                Sie können ein Material nicht finden? Oder es gibt Probleme damit?\r\n            </button></h2></div>\r\n    <div id=\"collapseTwentytwo\" class=\"collapse\" aria-labelledby=\"headingTwentytwo\" data-parent=\"#accordionFaqTwo\"><div class=\"card-body\">\r\n            Wenden Sie bitte an Administrator oder nutzen Sie Feedback Funktion .\r\n        </div></div></div><div class=\"card\"><div class=\"card-header\" id=\"headingTwentythree\"><h2 class=\"mb-0\"><button class=\"btn btn-link collapsed\" type=\"button\" data-toggle=\"collapse\" data-target=\"#collapseTwentythree\" aria-expanded=\"false\" aria-controls=\"collapseTwentythree\">\r\n                Kann ich auch von verschiedenen Geräten auf aLive Kurse zugreifen?\r\n            </button></h2></div>\r\n    <div id=\"collapseTwentythree\" class=\"collapse\" aria-labelledby=\"headingTwentythree\" data-parent=\"#accordionFaqTwo\"><div class=\"card-body\">\r\n            Alle internetfähige Endgeräte mit Brauserzugang benutzt werden.\r\n        </div></div></div><div class=\"card\"><div class=\"card-header\" id=\"headingTwentyfour\"><h2 class=\"mb-0\"><button class=\"btn btn-link collapsed\" type=\"button\" data-toggle=\"collapse\" data-target=\"#collapseTwentyfour\" aria-expanded=\"false\" aria-controls=\"collapseTwentyfour\">\r\n                Muss ich meinen aLive-Lerneinheit zu einem bestimmten Zeitpunkt beginnen? Und wie viel Zeit habe ich, ihn abzuschließen?\r\n            </button></h2></div>\r\n    <div id=\"collapseTwentyfour\" class=\"collapse\" aria-labelledby=\"headingTwentyfour\" data-parent=\"#accordionFaqTwo\"><div class=\"card-body\">\r\n            Admin oder Moderator kann die Zeit einstellen. Falls es eine Zeitgrenze gibt, wird an der Lerneinheit angezeigt.\r\n        </div></div></div></div>\r\n\r\n\r\n    ");
            __builder.AddMarkupContent(4, "<h3 style=\"        padding-bottom: 12px;\r\n        padding-top: 32px\r\n\">Administratoren:</h3>\r\n    ");
            __builder.AddMarkupContent(5, "<div class=\"accordion\" id=\"accordionFaqThree\" style=\"box-shadow: 0 4px 8px 0 rgba(0, 0, 0, 0.2), 0 6px 20px 0 rgba(0, 0, 0, 0.19);\"><div class=\"card\"><div class=\"card-header\" id=\"headingOne\"><h2 class=\"mb-0\"><button class=\"btn btn-link\" type=\"button\" data-toggle=\"collapse\" data-target=\"#collapseOne\" aria-expanded=\"false\" aria-controls=\"collapseOne\">\r\n                        Wie kann ich einen Kurs anlegen\r\n                    </button></h2></div>\r\n\r\n            <div id=\"collapseOne\" class=\"collapse\" aria-labelledby=\"headingOne\" data-parent=\"#accordionFaqThree\"><div class=\"card-body\">\r\n                    Als Administrator kann man unter ‘Courses’ die Option ‘add’ auswählen.\r\n                    Dabei wird ein noch nicht sichtbarer Kurs erzeugt. Wenn man mit dem Erstellen fertig ist, muss der Kurs noch veröffentlicht werden. Dazu dient der Knopf ‘publish’.\r\n\r\n                </div></div></div>\r\n        <div class=\"card\"><div class=\"card-header\" id=\"headingTwo\"><h2 class=\"mb-0\"><button class=\"btn btn-link collapsed\" type=\"button\" data-toggle=\"collapse\" data-target=\"#collapseTwo\" aria-expanded=\"false\" aria-controls=\"collapseTwo\">\r\n                        Wie lade ich multimediale Inhalte (Videos, Bilder, PDFs) hoch?\r\n                    </button></h2></div>\r\n            <div id=\"collapseTwo\" class=\"collapse\" aria-labelledby=\"headingTwo\" data-parent=\"#accordionFaqThree\"><div class=\"card-body\">\r\n                    Als Administrator muss die Kategorie des Kurses ‘video course’ aktiviert werden. Dann erscheint die Möglichkeit ein video zu uploaden.\r\n                    Bilder und PDFs können zu jedem Kurs (und Test) hinzugefügt werden.\r\n\r\n                </div></div></div>\r\n        \r\n        <div class=\"card\"><div class=\"card-header\" id=\"headingThree\"><h2 class=\"mb-0\"><button class=\"btn btn-link collapsed\" type=\"button\" data-toggle=\"collapse\" data-target=\"#collapseThree\" aria-expanded=\"false\" aria-controls=\"collapseThree\">\r\n                        Wie kann ich bereits veröffentlichte Inhalte bearbeiten?\r\n                    </button></h2></div>\r\n            <div id=\"collapseThree\" class=\"collapse\" aria-labelledby=\"headingThree\" data-parent=\"#accordionFaqThree\"><div class=\"card-body\">\r\n\r\n                    Als Administrator kann man in der Kursansicht auf Bearbeiten klicken.\r\n\r\n                </div></div></div></div>\r\n    \r\n    ");
            __builder.AddMarkupContent(6, @"<div class=""card""><div class=""card-header"" id=""headingFour""><h2 class=""mb-0""><button class=""btn btn-link collapsed"" type=""button"" data-toggle=""collapse"" data-target=""#collapseFour"" aria-expanded=""false"" aria-controls=""collapseFour"">
                    Was passiert, wenn der Administrator die Lerneinheit aus aLive entfernt?
                </button></h2></div>
        <div id=""collapseFour"" class=""collapse"" aria-labelledby=""headingFour"" data-parent=""#accordionFaqThree""><div class=""card-body"">
                Wenn der Kurs von dem Lehrer gelöscht wird,  wird automatisch bei der Nutzer gelöscht. Der Kurs kann auch in einer bestimmten Zeitraum wiederhergedstellt werden.
            </div></div></div>

